export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},IWiJT6QBEu:{data:{id:2367,attributes:{imdbId:"tt0386117",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNzQ1NzAwODEwM15BMl5BanBnXkFtZTcwNTE4MjI4Mg@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.7\u002F10"},{Source:"Rotten Tomatoes",Value:"73%"},{Source:"Metacritic",Value:"71\u002F100"}],item_lang:{data:{id:3030,attributes:{title:e,plot:"A young boy named Max has an active imagination, and he will throw fits if others don't go along with what he wants. Max - following an incident with Claire (his sister) and her friends, and following a tantrum which he throws as a result of his Mother paying more attention to her boyfriend than to him - runs away from home. Wearing his wolf costume at the time, Max not only runs away physically, but runs toward a world in his imagination. This world, an ocean away, is inhabited by large wild beasts, including one named Carol who is much like Max himself in temperament. Instead of eating Max like they normally would with creatures of his type, the wild things befriend Max after he proclaims himself a king who can magically solve all their problems.",slug:"where-the-wild-things-are"}}},books:{data:[{id:11504,attributes:{title:e,description:"Read-along with the story in this book and CD edition! One night Max puts on his wolf suit and makes mischief of one kind and another, so his mother calls him 'Wild Thing' and sends him to bed without his supper. That night a forest begins to grow in Max's room and an ocean rushes by with a boat to take Max to the place where the wild things are. Max tames the wild things and crowns himself as their king, and then the wild rumpus begins. But when Max has sent the monsters to bed, and everything is quiet, he starts to feel lonely and realises it is time to sail home to the place where someone loves him best of all.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=74E_nQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:true,published:"2015-08-27",publisher:"Red Fox",subtitle:a}},{id:11505,attributes:{title:"Where the Wild Things Are. Story and Pictures of Maurice Sendak",description:"A boy is sent to bed withouth his supper and imagines he becomes king of the wild things.",thumbnail:a,authors:[c],firstBook:d,published:"1963-01-01",publisher:a,subtitle:a}},{id:11506,attributes:{title:e,description:"Where the Wild Things Are, one of the wildest and most memorable picture books ever created, is now a movie full of adventure and mystery - and huge hairy creatures. Follow Max, a rambunctious boy who feels misunderstood at home, as he sets out on a tiny boat seeking new worlds across the sea. He lands on the incredible island of the Wild Things, a place where being a beast isn't a bad thing. The Wild Things make Max their king, and he reigns over a land of friendly battles, 100 foot tall dogs, enormous forts and amazing chases. But life on the island is full of challenges too. The Wild Things expect a lot of their king, and if he doesn't please them, there's a good chance he'll be eaten. Where the Wild Things Are has sold over 19 million copies worldwide since its original publication in 1963. The winner of the 1964 Caldercott Medal, the story of Max and the Wild Things has become an icon of children's literature. Now, Spike Jonze brings the magic of Where the Wild Things Are to the big screen.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UsW1PwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Barbara Bersche","Michelle Quint",c,"Puffin Books Staff","Penguin Books Staff"],firstBook:d,published:"2009-01-01",publisher:a,subtitle:a}},{id:11507,attributes:{title:"Where the Wild Things are",description:a,thumbnail:a,authors:[c],firstBook:d,published:"1970-01-01",publisher:a,subtitle:"And Getting to Know Maurice Sendak"}},{id:11508,attributes:{title:"Where the Wild Things Are - Literature Kit Gr. 1-2",description:"In this State Standards-aligned Literature Kitâ„¢, we feature ready-to-use information and activities for beginning readers. We include activities in language, reading comprehension and writing that focus on phonics, word study, comprehension, writing, and reading response. Start off an open discussion with the Before You Read discussion questions. Then, read the story out loud as you use the As You Read questions to engage the students in the story. Follow-up with the After You Read questions to see if the students have comprehended the story. Also included are writing tasks, graphic organizers, comprehension quiz, test prep, word search, and crossword to further develop students' critical thinking and writing skills, and analysis of the text. About the Novel: This story is based on a mischievous boy named Max, who dresses up in a wolf suit and does things he shouldn't. His mom gets upset and calls him a Wild Thing! Max retaliates by screaming back to his mom, \"I'll eat you up!\" From within his imagination, Max's room goes from forest to ocean with Max inside the little boat where he comes up to the land of Wild Things. Max becomes lonely and he smells good things to eat. Wanting to be with someone who loved him best of all, he leaves the land of Wild Things. He comes back to his own room where he finds his supper, still hot, waiting for him. All of our content is aligned to your State Standards and are written to Bloom's Taxonomy.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sxLdBwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Marie-Helen Goyetche"],firstBook:d,published:"2007-01-01",publisher:"Classroom Complete Press",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681703480379}}("","movie","Maurice Sendak",null,"Where the Wild Things Are","series",1))